The perfect combination of a refreshing salad and a heartier dish, packed with protein and fibre and filled with all those wonderful Mexican flavor flaves! Serve as a meal in itself with avocado or guacamole, add to your Buddah bowls or alongside just about anything! Keeps well in the fridge for a week (if it lasts that long). 

Ingredients:
1.5 cups (250ml a cup) quinoa of choice 
1 cup black beans 
1 cup sweetcorn 
Â½ cup olives
1 cup cherry tomatoes
1 small cucumber
1 cup rocket/ arugula leaves
Â½ cup shredded purple cabbage
2 green onions
1 cup fresh coriander
Â¼ green chili pepper 
Juice of lime
1 tsp sumac, 1 tsp cumin, Â½ tsp chili powder, Â½ tsp garlic, Â½ tsp black coarse pepper, Â½ tsp coriander seeds 
Salt to taste
3 tbsp olive oil

1ï¸âƒ£ Place the quinoa in a saucepan and add double the amount of boiling water (3 cups) and cook on a med-high light, stirring occasionally until ready (approx. 15 mins). Remove from heat and place a lid on the pan for 10 mins which will allow the quinoa to fluff up in itâ€™s own steam. Then let cool and transfer to a bowl.
2ï¸âƒ£ Drain the beans and corn (if using cans as I did) and add to the quinoa. 
3ï¸âƒ£ Slice all the veggies, olives and herbs and add to the bowl. 
4ï¸âƒ£ Fry the coriander seeds on a med-high heat on olive oil for 2 mins and then remove from the heat, crush them and sprinkle over the salad. 
5ï¸âƒ£ Squeeze the lime over the salad starting with half a lime, add the olive oil and all the spices. Adjust to taste. 

